import React from "react";
import CreateIcon from "@mui/icons-material/Create";

const SideBar = () => {
  return (
    <div className="sidebar">
      <button className="compose" startIcon={<CreateIcon></CreateIcon>}>
        COMPOSE
      </button>
    </div>
  );
};

export default SideBar;
